d += "<td>商品类型</td>";
d += "<td>车号</td>";
d += "<td>应收金额</td>";
d += "<td>进场时间</td>";
d += "<td>出场时间</td>";
d += "<td>训练时长</td>";
d += "<td>加收金额</td>";    
d += "<td>实收金额</td>";
d += "<td>是否训练结束</td>";  
d += "<td>驾校</td>";
d += "</tr>";

for (var y = 0; y < g5.dataset2.rowCount; y++) {
    d += "<tr>";
    for (var x = 0; x < g5.dataset2.colCount; x++) {   
        if(x == 4){             
            var timestamp3 = g5.dataset2.getData(x,y);
            var newDate = new Date();
            newDate.setTime(timestamp3 * 1000);
            var in_time  = newDate.toLocaleString();
            d += "<td>" + in_time + "</td>";
        }else if(x == 5){
            if(g5.dataset2.getData(x,y) == ""){
                d += "<td>" + g5.dataset2.getData(x,y) + "</td>";
            }else {
                var timestamp3 = g5.dataset2.getData(x,y);
                var newDate = new Date();
                newDate.setTime(timestamp3 * 1000);
                var out_time  = newDate.toLocaleString();
                d += "<td>" + out_time + "</td>";
            }
        } else  if(x == 6){
            if(g5.dataset2.getData(x,y) == ""){
                d += "<td>" + g5.dataset2.getData(x,y) + "</td>";
            }else { 
                var timestamp3 = g5.dataset2.getData(x,y);
                var date = new Date(timestamp3 * 1000);         
                h = date.getHours();       
                h = h - 8;   
                h = h < 10 ? '0'+ h : h;
                m = date.getMinutes();    
                m = m < 10 ? '0'+ m : m;     
                var time = h+":"+m;
                d += "<td>" + time + "</td>";
            }
        } else if(x == 9){
            if(g5.dataset2.getData(x,y) == 0){
                d += "<td>未入场</td>";
            }else if(g5.dataset2.getData(x,y) == 1) { 
                d += "<td>训练中</td>";
            }else if (g5.dataset2.getData(x,y) == 2){
                d += "<td>已出场</td>";
            }else if (g5.dataset2.getData(x,y) == 3){
                d += "<td>已使用</td>";
            }else {
                d += "<td>异常</td>";
            }
        } else  if(x == 10){
            if(g5.dataset2.getData(x,y) == 3){
                d += "<td>华茂驾校</td>";
            }else if(g5.dataset2.getData(x,y) == 4) { 
                d += "<td>华茂驾校</td>";
            }else {
                d += "<td>异常</td>";
            }
        } else {
            d += "<td>" + g5.dataset2.getData(x,y) + "</td>";       
        }
    }
    d += "</tr>";
}
d = "<table>" + d + "</table>";

tableToExcel(d, "气瓶数据");

